import React from 'react';
import nba from 'nba';
import {Profile} from './Profile'
import { DataViewContainer } from './DataViewContainer';

window.nba = nba;

export class Main extends React.Component {
    state = {
        playerInfo: {
            playerId: 201939
        }
    }
    componentDidMount() {
        /* const playerId = nba.findPlayer('Stephen Curry').playerId; */
        const { playerId } = nba.findPlayer('Stephen Curry');
        console.log('Player Info3:');
        nba.stats.playerInfo({PlayerID: playerId}).then(
            (info) => {
                console.log(info);
                const commonPlayerInfo = info.commonPlayerInfo[0];
                const playerHeadlineStats = info.playerHeadlineStats[0];
                const playerInfo = {
                    ...commonPlayerInfo,
                    ...playerHeadlineStats
                };
                this.setState({
                   playerInfo
                });
            }
        );

    }

    render() {
        return (
            <div className = "main">
                <Profile playerInfo = {this.state.playerInfo}/>
                <DataViewContainer playerId={this.state.playerInfo.playerId}/>isplayToolTips={true}
                />
            </div>
        )
    }
}
